  const navRef = useRef();

  const showNavbar = () => {
    navRef.current.classList.toggle("responsive_nav");
  };

  return (
    <>
      <nav>
        <input type="checkbox" id="check" />
        <label htmlFor="check" className="checkbtn">
          <i className="bx bx-menu">
            <button>
              {" "}
              <FaBars />
            </button>
          </i>
        </label>
        <ul>
          <li>
            <a href="#" className="active">
              home
            </a>
          </li>
          <li>
            <a href="#">about</a>
          </li>
          <li>
            <a href="#">sevices</a>
          </li>
          <li>
            <a href="#">contact</a>
          </li>
        </ul>
      </nav>
      <section></section>
    </>
  );
}

export default NavBarNew;
